-
125g parsnip, grated
250g spelt flour
2 tsp baking powder
1 tsp baking soda
1 tsp cinnamon
125g (coconut) sugar 
4 tbsp raw cocoa powder
50g ground hazelnuts 
200g apple purée
100ml oil 
50ml sparkling water 
For the glaze: 100g dark vegan chocolate and hazelnuts 
Preheat the oven to 180C/350F. Mix the parsnip with all dry ingredients and stir well, add all the other ingredients and combine well but don’t overmix. Prepare a round or load tin with baking paper and transfer the batter into the tin. Bake for around 50 min. Let the cake cool down, melt the chocolate and spread evenly over the cake. Sprinkle with hazelnuts. Let it dry completely before serving. .
