Directions:
✨Mushrooms/Meat: Marinate ground meat (I used turkey) with minced garlic, minced ginger, soy sauce, and a splash of sesame oil and mirin. Slice fresh shiitake mushrooms.  Sauté the marinated meat until 80% cooked, then remove and place in a bowl. Reheat some sesame oil and brown the mushrooms and garlic- do NOT touch the mushrooms till one side is brown! Then add the meat, season to taste w additional salt/soy sauce.
✨ Bok choy and carrots: wash and slice veggies. heat pan with neutral oil. Add carrots and sliced garlic; sauté for 1 minute. Add the bok choy and a tablespoon of water; cover and steam until tender. Season to taste.
✨ Serve with brown rice, green onion, kimchi, and toasted sesame seeds!
